  CONSTRAINT `outsourcer_id85` FOREIGN KEY (`outsourcer_id`) REFERENCES `outsourcer` (`id`),
  CONSTRAINT `project_id654` FOREIGN KEY (`project_id`) REFERENCES `project` (`id`)
