DROP TRIGGER IF EXISTS `datesum`;
DELIMITER ;;
CREATE TRIGGER `datesum` BEFORE INSERT ON `project_allowance_detail` FOR EACH ROW set  new.date_sum = TIMESTAMPDIFF(day,new.start_date,new.end_date) +1
;;
DELIMITER ;
